import React from 'react';
import { useMemo } from "react";
import dataJson from "./data.json"
import './App.css';
import InfoCardList from "./components/InfoCardsList";

export type MachineData = {
  id: number
  name: string
  description: string
  year: number
  imageUrl: string
  categories: []
}


function App() {

  const objects = useMemo(() => dataJson.data as [MachineData], [])

  return (
    <div className="App" style={{
      marginTop: "50px",
      marginLeft:"150px",
      marginRight:"100px",
      backgroundColor:"gray",

    }} >
      <div className = "links" style={{
        backgroundColor:'black',
        width: "100%",


      }}>
        <a style = {{
          color:"white",
        }}href="#">HOME</a>
        <a style = {{
          color:"white",
        }}href="#">HARDWARE</a>
        <a style = {{
          color:"white",
        }}href="#">EXTENSIONS</a>
        <a style = {{
          color:"white",
        }}href="#">METHODOLOY</a>
      </div>
      <InfoCardList items={objects} />
    </div>

  );
}

export default App;
